import React from "react";

const SortButton = ({ handleSortAscend, handleSortDescend }) => {
  return (
    <div>
      <div>
        <span>並び替え（登録順）：</span>
        <button onClick={() => handleSortAscend()}>昇順</button>
        <button onClick={() => handleSortDescend()}>降順</button>
      </div>
    </div>
  );
};

export default SortButton;
